{
  "Comment": "A description of my state machine",
  "StartAt": "Data Generation",
  "States": {
    "Data Generation": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "FunctionName": "arn:aws:lambda:us-east-1:361242421444:function:serializeImageData:$LATEST",
        "Payload": {
          "inferences": [
            0.9978086352348328,
            0.002191332168877125
          ],
          "image_data": "",
          "s3_key": "test/bicycle_s_000513.png",
          "s3_bucket": "mlworkflowproject"
        }
      },
      "Next": "Image Classification",
      "InputPath": "$"
    },
    "Image Classification": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:361242421444:function:classifyImageData:$LATEST"
      },
      "Next": "Inference Filtering",
      "InputPath": "$"
    },
    "Inference Filtering": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-east-1:361242421444:function:inferencefilter:$LATEST"
      },
      "End": true,
      "InputPath": "$"
    }
  }
}
